import React from 'react';
import Navbar from './components/Header/Navbar';
import Home from './components/Home';
import Join from './components/Join';

const App = () => {
    return (
        <>
            <Navbar />
            <div className="container mt-2" style={{ marginTop: 40 }}>
                <Home />
                <Join />
            </div>
        </>
    )
}

export default App;
